import {formatDate} from '@/utils/formatTime'
import { TIRUtils } from "@/utils/algorithm/TIR";
// 监听主线程传来的消息
self.addEventListener('message',(e)=>{
    // heavyCalculation(e.data)
    self.postMessage(heavyCalculation(e.data))
})
// 处理数据
function heavyCalculation(data){
    let array = data
     // 将数组按天分割
     let dayMap = new Map()
     array.forEach((item,index)=>{
        if(dayMap.size<=14){
            item.day = formatDate(item.DataTs*1000,'mm.dd')
            item.week = formatDate(item.DataTs*1000,'WW')
            item.moment = Number(formatDate(item.DataTs*1000,'HH'))*60+Number(formatDate(item.DataTs*1000,'MM'))
            item.dayArray = new Array(24*60)
            item.dayArray[item.moment] = item.Value
            dayMap.has(item.day) ? dayMap.get(item.day).value[item.moment]=item.Value: dayMap.set(item.day, {value:item.dayArray,week:item.week,tir:TIRUtils.getTIRResult(item.dayArray)?TIRUtils.getTIRResult(item.dayArray).normalRate:0});
        }
    })
    return dayMap
}
